import './App.css';
import { Canvas } from '@react-three/fiber'

function App() {
  return (
    <div id='canvas-container'>
      <Canvas>
        <mesh>
          <boxGeometry args={[3, 2, 2]} />
        </mesh>
      </Canvas>
    </div>
  );
}

export default App;
